import React from 'react';
import ReactDOM from 'react-dom';


class myApp extends React.Component {
    render() {
        return(
            <h1>Hello World.</h1>

        )
    }
}

class Car extends React.Component {
    render() {
        return (
            <p>I am a Car.</p>
        )
    }
}
ReactDOM.render(myApp, document.getElementById('root'));
